import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

const roleIcons = {
  Batsman: 'https://images.vexels.com/media/users/3/316363/isolated/preview/02c4382e5d08daec77666410ddae3e6a-cricket-bat.png',
  Bowler: 'https://pngimg.com/uploads/cricket/cricket_PNG85.png',
  AllRounder: 'https://png.pngtree.com/png-clipart/20221213/ourmid/pngtree-cricket-stamps-png-image_6521913.png'
};

const TeamFormPage2 = () => {
  const [formData, setFormData] = useState({
    player1: "",
    player2: "",
    player3: "",
    player4: "",
    player5: "",
    player6: "",
    player7: "",
    player8: "",
    player9: "",
    player10: ""
  });

  const [roles, setRoles] = useState({
    player1Role: "",
    player2Role: "",
    player3Role: "",
    player4Role: "",
    player5Role: "",
    player6Role: "",
    player7Role: "",
    player8Role: "",
    player9Role: "",
    player10Role: ""
  });

  const navigate = useNavigate();

  useEffect(() => {
    const storedData = JSON.parse(localStorage.getItem("teamFormData"));
    if (storedData) {
      setFormData((prev) => ({ ...prev, ...storedData }));
    } else {
      navigate("/register");
    }
  }, [navigate]);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleRoleChange = (index, role) => {
    setRoles({
      ...roles,
      [`player${index + 1}Role`]: role,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const completeFormData = JSON.parse(localStorage.getItem("teamFormData"));
    localStorage.setItem("teamFormData", JSON.stringify({ ...completeFormData, ...formData, roles }));
    
    navigate("/success"); // Removed clearing localStorage
  };

  return (
    <div className="container mx-auto p-4">
      <div className="max-w-3xl mx-auto opacity-0 animate-fade-in">
        <h2 className="text-2xl font-bold mb-4 text-center">Add Players</h2>
        <form onSubmit={handleSubmit} className="space-y-6">
          {[...Array(10)].map((_, index) => (
            <div key={index} className="flex items-center justify-between opacity-0 animate-slide-in">
              <div className="flex-1">
                <label className="block text-sm font-medium text-gray-700">
                  Player {index + 1}
                </label>
                <input
                  type="text"
                  name={`player${index + 1}`}
                  value={formData[`player${index + 1}`]}
                  onChange={handleChange}
                  className="mt-1 block w-full px-6 py-2 border border-gray-300 rounded-md text-sm transition-all duration-300 ease-in-out hover:shadow-lg focus:border-blue-500 focus:outline-none"
                  required
                />
              </div>
              <div className="flex items-center ml-6">
                <label className="block text-lg font-medium text-gray-700 mr-2">Role:</label>
                <div className="flex">
                  {["Batsman", "Bowler", "AllRounder"].map((role) => (
                    <div key={role} className="mr-4 flex items-center">
                      <input
                        type="radio"
                        name={`player${index + 1}Role`}
                        value={role}
                        checked={roles[`player${index + 1}Role`] === role}
                        onChange={() => handleRoleChange(index, role)}
                      />
                      <img
                        src={roleIcons[role]}
                        alt={`${role} Icon`}
                        className={`w-8 h-8 ml-1 transition-transform transform ${
                          roles[`player${index + 1}Role`] === role ? 'animate-bounce' : ''
                        }`}
                      />
                      <span className="text-lg ml-1">{role}</span>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          ))}

          <button
            type="submit"
            className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-600 text-lg transition-transform transform hover:scale-105 duration-300 ease-in-out"
          >
            Submit
          </button>
        </form>
      </div>
    </div>
  );
};

export default TeamFormPage2;
